functions.raw_rules:
/// @notice Query if a contract implements an interface
/// @param interfaceID The interface identifier, as specified in ERC-165
/// @dev Interface identification is specified in ERC-165. This function
///  uses less than 30,000 gas.
/// @return `true` if the contract implements `interfaceID` and
///  `interfaceID` is not 0xffffffff, `false` otherwise

extract_debug.throw:
[
  {
    "if": "interfaceID is 0xffffffff",
    "throw": false
  },
  {
    "if": "the contract does not implement the provided interfaceID",
    "throw": false
  }
]

extract_debug.return:
[
  {
    "ret_value": true,
    "if": "the contract implements interfaceID and interfaceID != 0xffffffff"
  },
  {
    "ret_value": false,
    "if": "interfaceID == 0xffffffff"
  },
  {
    "ret_value": false,
    "if": "the contract does not implement interfaceID"
  }
]
